import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from 'react-router-dom';
import Inlogpage from "./Pages/Inlog/InlogPage";
import RegisterPage from "./Pages/Register/RegisterPage";
import ThanksPage from "./Pages/Thanks/ThanksPage";
import FormPage from "./Pages/Form/FormPage"
import Dashboard from "./Pages/Dashboard/Dashboard.css";




function App() {
  return (
<Router>

  <Switch>
    <Route path="/dashboard">
      <Dashboard/>
    </Route>
    <Route path="/inlog">
      <Inlogpage/>
    </Route>
    <Route path="/register">
      <RegisterPage/>
    </Route>
    <Route path="/form">
      <FormPage/>
    </Route>
    <Route path="/thanks">
      <ThanksPage />
    </Route>

  </Switch>


</Router>


  );
}

export default App;
